import styled from "styled-components";

export const LoginWrapper = styled.div`

    h1 {
        margin: 10px;
    }

    .container {
        display:flex;
        justify-content: center;
        flex-flow: column nowrap;
        margin: 150px;
        border: 1px solid black;
        padding-top: 50px;
        padding-bottom: 50px;
    }

    input {
        padding: 10px 150px 10px 150px;
    }

    label {
        margin: 8px;
    }

`;
